import { FaGithub, FaLinkedin } from 'react-icons/fa';
import { FcDocument } from 'react-icons/fc';

const SocialButtons = () => {
  const buttonStyle = {
    borderRadius: '50%', // Make the button circular
    width: '50px', // Set the width of the button
    height: '50px', // Set the height of the button
    backgroundColor: '#333', // Background color of the button
    color: '#fff', // Text color
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    margin: '10px', // Margin between buttons
    textDecoration: 'none',
  };

  return (
    <div>
      <a href="https://github.com" style={buttonStyle}>
        <FaGithub size={24} />
      </a>
      <a href="https://linkedin.com" style={buttonStyle}>
        <FaLinkedin size={24} />
      </a>
      <a href="https://example.com/resume.pdf" style={buttonStyle}>
        <FcDocument size={24} />
      </a>
    </div>
  );
};

export default SocialButtons;
